library.add(faGithub);

class App extends Component {
  render() {


    return (

      <div className="App">
        <Navbar1 title="Github Finder" icon='fa fa-github' />
        <h1>Hello I am learning React</h1>
        <div className="container">
          <Users />
        </div>


      </div>

    );
  }
}

export default App;
